import{_ as l,c as i,o as a,a4 as e}from"./chunks/framework.4aTu-Nia.js";const o="/assets/image-2.MYT82WWx.png",m=JSON.parse('{"title":"JAVA 知识体系","description":"","frontmatter":{},"headers":[],"relativePath":"RD/java/knowledge.md","filePath":"RD/java/knowledge.md"}'),r={name:"RD/java/knowledge.md"},t=e('<h1 id="java-知识体系" tabindex="-1">JAVA 知识体系 <a class="header-anchor" href="#java-知识体系" aria-label="Permalink to &quot;JAVA 知识体系&quot;">​</a></h1><p><img src="'+o+'" alt="alt text" data-fancybox="gallery"></p><p>java 工程师：<a href="https://class.imooc.com/java2023#Anchor" target="_blank" rel="noreferrer">https://class.imooc.com/java2023#Anchor</a></p><h2 id="阶段一-java-零基础入门" tabindex="-1">阶段一：Java 零基础入门 <a class="header-anchor" href="#阶段一-java-零基础入门" aria-label="Permalink to &quot;阶段一：Java 零基础入门&quot;">​</a></h2><p>26 门课 /课程总时长：45 小时 /练习题：380 /大作业：3 /考试：3 /教辅资料：121</p><h3 id="环境搭建与语法入门" tabindex="-1">环境搭建与语法入门 <a class="header-anchor" href="#环境搭建与语法入门" aria-label="Permalink to &quot;环境搭建与语法入门&quot;">​</a></h3><p>万丈高楼平地起，地基打的结实，未来才走的更远，本周的学习目标就是帮大家打好语法关</p><p>课程安排：</p><ul><li>1、Java 基本概念介绍</li><li>2、Windows 和 Mac 下开发环境搭建</li><li>3、数据类型、变量和常量的使用</li><li>4、Java 中多种运算符的应用</li><li>5、选择结构的执行流程与应用</li></ul><h3 id="循环、数组与方法" tabindex="-1">循环、数组与方法 <a class="header-anchor" href="#循环、数组与方法" aria-label="Permalink to &quot;循环、数组与方法&quot;">​</a></h3><p>地基打的牢，大楼盖的高，本周的学习目标是掌握本周内容可以进行简单的程序逻辑开发。</p><p>课程安排：</p><ul><li>1、基础语法综合案例——数组移位与统计</li><li>2、while、do-while 和 for 三种循环结构的使用</li><li>3、嵌套循环的应用</li><li>4、break 和 continue 语句的特点及应用</li><li>5、如何进行程序的调试，debug 的使用</li><li>6、一维数组和二维数组的应用</li><li>7、Java 自定义方法和方法调用</li><li>8、大作业——学生成绩管理</li></ul><h3 id="面向对象之封装与继承" tabindex="-1">面向对象之封装与继承 <a class="header-anchor" href="#面向对象之封装与继承" aria-label="Permalink to &quot;面向对象之封装与继承&quot;">​</a></h3><p>在 Java 的世界里，万物皆对象,那什么是对象，如何面向对象编程？没有对象是否可以编程？本周将带你走入 Java 对象的世界，领略面向对象的编程思想，并学会用面向对象的思想进行程序开发。</p><p>课程安排：</p><ul><li>1、封装综合案例——学生信息管理</li><li>2、类的定义和对象的创建</li><li>3、理解构造方法的概念，并进行应用</li><li>4、封装的特点，应用代码实现程序的封装</li><li>5、包的创建和导入</li><li>6、静态变量和静态方法的应用</li><li>7、大作业——部门员工管理</li><li>8、继承的概念和特点，父类和子类的概念及应用</li><li>9、方法重写的特点及使用</li><li>10、通过 super 关键字对父类方法进行调用</li></ul><h3 id="面向对象之单例模式与多态" tabindex="-1">面向对象之单例模式与多态 <a class="header-anchor" href="#面向对象之单例模式与多态" aria-label="Permalink to &quot;面向对象之单例模式与多态&quot;">​</a></h3><p>上周大家已经简单了解对象，并会使用面向对象思想进行简单的程序开发，但面向对象就只有这些知识吗？本周将带大家掌握更深入的面向对象知识，并学会用面向对象思想开发更复杂的应用。</p><p>课程安排：</p><ul><li>1、所有类的父类 Object 类的使用</li><li>2、使用 final 关键字定义最终类</li><li>3、现阶段开发中涉及到的常用注解的使用</li><li>4、单例模式的定义和使用</li><li>5、懒汉模式和饿汉模式的特点及代码实现</li><li>6、向上转型和向下转型的概念和应用</li><li>7、接口和抽象类的定义和使用</li><li>8、成员内部类、静态内部类、方法内部类和匿名内部类的应用</li></ul><h3 id="异常、包装类与字符串" tabindex="-1">异常、包装类与字符串 <a class="header-anchor" href="#异常、包装类与字符串" aria-label="Permalink to &quot;异常、包装类与字符串&quot;">​</a></h3><p>工具类是 Java 为我们提供的拿来就用的可复用的“轮子”，工具类的使用是实际开发中非常重要的技能。本周将带你系统掌握异常、包装类与字符串等常用工具类的使用方法。</p><p>课程安排：</p><ul><li>1、使用 try-catch-finally 处理异常</li><li>2、理解 throw 和 throws 的区别，会使用自定义异常和异常链</li><li>3、包装类的基本使用，理解装箱和拆箱的概念</li><li>4、字符串处理类 String 和 StringBuffer 的基本使用和应用场景</li></ul><h3 id="集合、泛型、多线程、i-o" tabindex="-1">集合、泛型、多线程、I/O <a class="header-anchor" href="#集合、泛型、多线程、i-o" aria-label="Permalink to &quot;集合、泛型、多线程、I/O&quot;">​</a></h3><p>手里的工具越多，解决问题时的办法才越多。本周将结合案例，让大家学会更多的常用工具类--集合、泛型、多线程、I/O 流等，为后续的项目实战打下坚实的基础。</p><p>课程安排：</p><ul><li>1、阶段综合案例——多线程下载器</li><li>2、JDK 不同版本的新特性—基础篇</li><li>3、泛型的使用，包括自定义泛型类和泛型方法</li><li>4、线程的创建，理解线程的生命周期</li><li>5、线程同步的使用和如何进行线程间通信</li><li>6、使用字节流和字符流进行数据传输</li></ul><h2 id="阶段二-java-数据库开发与实战" tabindex="-1">阶段二：Java 数据库开发与实战 <a class="header-anchor" href="#阶段二-java-数据库开发与实战" aria-label="Permalink to &quot;阶段二：Java 数据库开发与实战&quot;">​</a></h2><p>15 门课 /课程总时长：32 小时 /练习题：124 /大作业：1 /考试：1 /教辅资料：32</p><h3 id="mysql" tabindex="-1">MySQL <a class="header-anchor" href="#mysql" aria-label="Permalink to &quot;MySQL&quot;">​</a></h3><p>互联网项目什么最重要？数据，数据如何管理，如何更安全？这就不得不用到数据库，本周将带大家一起玩转主流数据库-MySQL。</p><p>课程安排：</p><ul><li>1、根据数据库规范设计数据库</li><li>2、数据库的创建、表的创建和修改等操作</li><li>3、数据表的增删改查等基本操作</li><li>4、数据库的数字、日期时间、字符等常用函数使用</li><li>5、事务的 ACID 属性和隔离级别</li><li>6、SQL 文件的导入和导出</li></ul><h3 id="java-与数据库连接的桥梁" tabindex="-1">Java 与数据库连接的桥梁 <a class="header-anchor" href="#java-与数据库连接的桥梁" aria-label="Permalink to &quot;Java 与数据库连接的桥梁&quot;">​</a></h3><p>上周我们学习了数据库的知识，那如何用 Java 代码操作数据库呢？以及有没有更高效的方式操作数据库？这将是本周学习的重点。</p><p>课程安排：</p><ul><li>1、xml 基础语法以及约束文件</li><li>2、使用 JDBC 实现数据的增删改查</li><li>3、使用 PreparedStatment 对数据进行预处理，防止 SQL 注入漏洞</li><li>4、数据库连接池 Druid 和 C3P0 的使用</li><li>5、使用 Apache 的数据库工具类 DBUtils 简化代码开发</li></ul><p>第 11 周 Java 高级编程 本周将带大家快速学会如何使用 Maven 进行项目管理，并一起解锁一些高级的编程知识-工厂模式，反射，Java8 新特性-Lambda 表达式，Stream API 等。为后续基于框架的开发打好基础。</p><p>课程安排：</p><ul><li>1、Maven 的常用命令</li><li>2、在 IntelliJ IDEA 和 Eclipse 两种开发环境下创建 Maven 项目</li><li>3、工厂模式中简单工厂和工厂方法的特点及应用</li><li>4、反射的基本概念和四个反射类 Class、Field、Method、Constructor 的使用</li><li>5、Lambda 表达式的基本语法</li><li>6、Lambda 表达式的静态方法、实例方法、对象方法和构造方法的的引用</li><li>7、Stream API 的创建、中间操作和终止操作</li></ul><h3 id="mybatis" tabindex="-1">MyBatis <a class="header-anchor" href="#mybatis" aria-label="Permalink to &quot;MyBatis&quot;">​</a></h3><p>实际项目大部分都是基于框架开发，这将极大的提升项目的开发效率。因此非常有必要尽早的学会各种主流框架，首先我们学习的第一个框架是 Mybatis。通过 MyBatis 的学习，将极大的提升 Java 与数据库交互的效率。</p><p>课程安排：</p><ul><li>1、MyBatis 开发的基本流程</li><li>2、MyBatis 参数传递</li><li>3、MyBatis 多表关联查询</li><li>4、使用 logback 进行日志管理</li><li>5、使用动态 SQL 语句进行稍复杂的逻辑开发</li><li>6、MyBatis 一级缓存与二级缓存的概念和应用</li><li>7、MyBatis 对象关联查询</li><li>8、使用 PageHelper 插件进行数据分页</li><li>9、使用 MyBatis 进行数据的批量插入和删除</li><li>10、MyBatis 常用注解</li></ul><h2 id="阶段三-入门-java-web" tabindex="-1">阶段三：入门 Java Web <a class="header-anchor" href="#阶段三-入门-java-web" aria-label="Permalink to &quot;阶段三：入门 Java Web&quot;">​</a></h2><p>15 门课 /课程总时长：52 小时 /练习题：172 /大作业：2 /考试：2 /教辅资料：43</p><h3 id="html、css-与-js" tabindex="-1">HTML、CSS 与 JS <a class="header-anchor" href="#html、css-与-js" aria-label="Permalink to &quot;HTML、CSS 与 JS&quot;">​</a></h3><p>Web 项目大多都有精美的网页，这些网页都是用前端技术实现的，本周将带大家学会前端编程必备基础-HTML，CSS，JS，并最终带大家开发一个好看的网页！</p><p>课程安排：</p><ul><li>1、HTML 的基本结构和字体、标题、列表、图片等常用标签的使用</li><li>2、表格和表单标签的使用以及常用属性</li><li>3、CSS 的基本使用和常用样式</li><li>4、CSS 的各种选择器及其应用</li><li>5、浮动和定位的使用</li><li>6、使用盒子模型进行页面布局管理</li><li>7、JavaScript 变量、运算符、程序控制语句等基本语法</li><li>8、JavaScript 常用函数和自定义函数</li><li>9、JavaScript 数组的基本使用</li></ul><h3 id="vue3-入门" tabindex="-1">VUE3 入门 <a class="header-anchor" href="#vue3-入门" aria-label="Permalink to &quot;VUE3 入门&quot;">​</a></h3><p>上周我们学习了如何搭建一个网页，那如何让网页可以动起来，可以有特效呢？本周将带大家为网页增加特效，动起来！并结合所学知识，实战一个大的案例，还会学习一个前端非常火热的框架！是不是很期待？Let&#39;s GO! 课程安排：</p><ul><li>1、学习使用 DOM 获取页面元素</li><li>2、学习使用 DOM 修改元素属性</li><li>3、学习 BOM 中的 window 事件</li><li>4、学习 ES6 中的常量与变量</li><li>5、学习 ES6 中的解构赋值与箭头函数等</li><li>6、前端综合案例——仿慕课首页开发</li><li>7、入门前端流行框架 VUE3.0</li></ul><h3 id="java-web-编程急速入门" tabindex="-1">Java Web 编程急速入门 <a class="header-anchor" href="#java-web-编程急速入门" aria-label="Permalink to &quot;Java Web 编程急速入门&quot;">​</a></h3><p>Java Web 是 Java 开发的主要方向，也是 Java 程序员的必备技能，接下来跟随老师一起进入 Java Web 开发的大门吧！</p><p>课程安排：</p><ul><li>1、Tomcat 的安装与运行</li><li>2、学习 Servlet 的创建、运行和生命周期。</li><li>3、Java Web 的标准结构</li><li>4、GET 与 POST 请求方式</li><li>5、WEB 请求与响应解析</li><li>6、Session 与 ServletContext 原理</li><li>7、Java Web 打包与发布等</li></ul><h3 id="常用功能与过滤器" tabindex="-1">常用功能与过滤器 <a class="header-anchor" href="#常用功能与过滤器" aria-label="Permalink to &quot;常用功能与过滤器&quot;">​</a></h3><p>在 Web 开发中，经常有一些通用的功能需要开发，比如局部刷新数据、表单数据校验等，一旦掌握，后续即可重复使用，从而极大的提升开发效率，本周将带大家熟练掌握这些常用功能的开发和使用，为开发出具有良好体验的项目做好准备。</p><p>课程安排：</p><ul><li>1、Ajax 及 JSON 的基础语法</li><li>2、Ajax 实现动态数据刷新</li><li>3、正则表达式基本语法，完成常见数据验证</li><li>4、过滤器的生命周期和开发流程</li><li>5、使用过滤器解决中文乱码问题</li><li>6、过滤器链的概念和使用</li><li>7、使用过滤器完成多端设备自动适配的功能开发</li></ul><h3 id="oa-系统项目实战" tabindex="-1">OA 系统项目实战 <a class="header-anchor" href="#oa-系统项目实战" aria-label="Permalink to &quot;OA 系统项目实战&quot;">​</a></h3><p>想学好编程，不能只是纸上谈兵，更需要大量的项目实战。本周将手把手带大家开发一个员工请假管理系统-OA。 综合提升编程能力的同时掌握一个项目开发的完整过程。 课程安排：</p><ul><li>1、需求分析到数据库的设计至建表的过程</li><li>2、手把手搭建底层开发框架</li><li>3、基于工作流程开发一个完整的员工请假与审批应用</li><li>4、使用 RBAC 权限模型完成基于角色的权限控制</li><li>5、使用动态 SQL 确定不同角色访问的数据范围</li><li>6、基于 Vue3 开发登录页</li><li>7、使用 MD5 加密算法保证数据的安全性</li><li>8、参照案例完成项目作业</li><li>9、CentOS 7 系统、以及客户端工具 Xshell 和 XFtp 的下载和安装</li><li>10、Linux 系统目录结构和常用命令</li><li>11、文本编辑工具 vim</li><li>12、使用 tar 命令进行文件压缩和解压缩</li><li>13、使用 Bash shell 开发自动运维程序</li><li>14、使用 yum 进行软件安装卸载</li><li>15、Linux 的网络设置</li><li>16、Linux 下安装、部署并运行 Web 应用</li><li>17、Redis 下载安装、基本配置和常用命令</li><li>18、使用 Jedis 对 Redis 进行操作</li></ul><h2 id="阶段四-从-ssm-到-springboot-项目实战" tabindex="-1">阶段四：从 SSM 到 SpringBoot 项目实战 <a class="header-anchor" href="#阶段四-从-ssm-到-springboot-项目实战" aria-label="Permalink to &quot;阶段四：从 SSM 到 SpringBoot 项目实战&quot;">​</a></h2><p>13 门课 /课程总时长：53 小时 /练习题：47 /大作业：2 /考试：2 /教辅资料：55</p><h3 id="spring" tabindex="-1">Spring <a class="header-anchor" href="#spring" aria-label="Permalink to &quot;Spring&quot;">​</a></h3><p>Spring 框架几乎占据 JavaWeb 编程的整个世界。掌握 Spring 是 JavaWeb 编程的必经之路。本周将重点学习 Spring 框架中的控制反转 IoC、依赖注入 DI 和面向切面编程 AOP 等内容。</p><p>课程安排：</p><ul><li>1、Spring IoC、DI 和 AOP 等核心概念</li><li>2、Spring 实例化和管理 Bean 的方式</li><li>3、Spring 注解分类和常用注解应用</li><li>4、Spring AOP 开发与配置流程</li><li>5、Spring 五种通知类型与应用场景</li><li>6、PointCut 切人点表达式的语法规则及应用</li><li>7、JDK 动态代理和 CGLib 代理的执行过程及区别</li><li>8、JdbcTemplate 的使用步骤与增删改查实现</li><li>9、声明式事务与编程式事务的区别及开发流程</li><li>10、理解声明式事务七种事务传播行为</li><li>11、导入交易流水账单案例</li></ul><h3 id="spring-mvc" tabindex="-1">Spring MVC <a class="header-anchor" href="#spring-mvc" aria-label="Permalink to &quot;Spring MVC&quot;">​</a></h3><p>SpringMVC 框架可以极大的简化对数据的封装和传递的等问题，本周我们将带大家熟练掌握 SpringMVC 框架基本使用。</p><p>课程安排：</p><ul><li>1、SpringMVC 开发流程与环境配置</li><li>2、SpringMVC 数据绑定的实现</li><li>3、使用 RESTful 开发规范开发 API</li><li>4、使用 SpringMVC 解决跨域问题</li><li>5、SpringMVC 拦截器的基本使用</li><li>6、使用 SpringMVC 拦截器开发用户流量统计功能</li></ul><h3 id="ssm-开发社交网站" tabindex="-1">SSM 开发社交网站 <a class="header-anchor" href="#ssm-开发社交网站" aria-label="Permalink to &quot;SSM 开发社交网站&quot;">​</a></h3><p>本周我们将结合 Spring 和 SpringMVC 以及 Mybatis 三大框架 一起实现第一个企业级项目-“仿豆瓣”社交项目。在项目实战中快速增加大家对复杂业务的理解与主流框架综合实战的能力。 课程安排：</p><ul><li>1、项目的需求分析，用例设计，流程图绘制和数据库设计</li><li>2、使用 MyBatis-plus 敏捷开发插件实现数据的增删改查操作</li><li>3、使用 Ajax+腾讯 ArtTemplate 模板进行热门图书查询</li><li>4、基于 MyBatis 实现分页查询，并实现上拉&quot;加载更多&quot;功能</li><li>5、采用 Redis 对访问的图书内容进行缓存</li><li>6、用户评价、回复和点赞功能实现</li><li>7、应用阿里云短信验证实现注册登录</li><li>8、使用 Web 富文本编辑器 kindeditor 进行在线编辑</li><li>9、使用动态表单对图书信息进行处理</li><li>10、实现评价/回复的后台审核功能</li><li>11、使用 VUE3.0 开发前端展示页</li></ul><h3 id="spring-boot3" tabindex="-1">Spring Boot3 <a class="header-anchor" href="#spring-boot3" aria-label="Permalink to &quot;Spring Boot3&quot;">​</a></h3><p>带大家在 Springboot3 下进行数据库开发，如何整合 Mybatis，掌握 Starter 机制及整合过程中的作用原理，通过实战进一步集成 Mybatis Plus 框架，实现增删改查，涵盖高级特性的应用，提升效率和代码质量。</p><p>课程安排：</p><ul><li>1、JDK21 六大关键新特性精讲</li><li>2、新特性 1-文本模板</li><li>3、新特性 2-顺序集合</li><li>4、新特性 3-Record 模式</li><li>5、新特性 4-正则匹配 Switch</li><li>6、新特性 5-虚拟线程的原理与应用</li><li>7、Spring Boot 3 急速入门</li><li>8、快速上手创建测试第一个 Spring Boot Web 应用</li><li>9、Spring Boot 3 整合 Mybatis/Mybatis plus 实现数据库开发</li></ul><h3 id="社交网站项目重构升级" tabindex="-1">社交网站项目重构升级 <a class="header-anchor" href="#社交网站项目重构升级" aria-label="Permalink to &quot;社交网站项目重构升级&quot;">​</a></h3><p>讲解 Redis7 新版入门及实践，Web 和 Nginx，项目部署 Docker 容器化，团队协作开发主流版本控制 Git 与 Gitlab，使用 Springboot 实现社交网站 iReader 项目重构&amp;业务功能扩展及测试</p><p>课程安排：</p><ul><li>1、快速入门 Redis</li><li>2、理解 Redis 常用五大类型及典型应用场景</li><li>3、Redis 原理、核心配置与应用交互</li><li>4、Redis 在项目中应用的三大典型案例</li><li>5、Nginx 五大典型企业场景应用实战</li><li>6、初识 Docker,并进行环境安装搭建</li><li>7、Docker 基础及常用命令讲解&amp;应用部署案例实战</li><li>8、版本控制初识及 Git 快速入门</li><li>9、企业工作中 Git 四大常用操作实战</li><li>10、局域网下自建代码托管平台 GitLab 基础及应用实战</li><li>11、项目基础环境搭建及三大模块更新重构实战</li><li>12、完善后台认证与授权基础架构</li><li>13、开发后台管理功能</li><li>14、Redis+Nginx 实现项目架构优化实战</li><li>15、项目发布与部署</li></ul><h2 id="阶段五-java-分布式与微服务实战" tabindex="-1">阶段五：Java 分布式与微服务实战 <a class="header-anchor" href="#阶段五-java-分布式与微服务实战" aria-label="Permalink to &quot;阶段五：Java 分布式与微服务实战&quot;">​</a></h2><p>19 门课 /课程总时长：88 小时 /练习题：34 /大作业：1 /考试：1 /教辅资料：35</p><h3 id="分布式入门" tabindex="-1">分布式入门 <a class="header-anchor" href="#分布式入门" aria-label="Permalink to &quot;分布式入门&quot;">​</a></h3><p>本周学习分布式基础知识，快速提高面试竞争力,强化分布式架构体系的技术栈，包括 RabbitMQ、Seata 技术，在分布式或者微服务架构中实现认证与授权的 SaToken 框架。 课程安排：</p><ul><li>1、Java 项目演进之分布式架构</li><li>2、SpringBoot 多线程技术</li><li>3、分布式协调服务 Zookeeper</li><li>4、分布式调用 Dubbo3.0</li><li>5、消息队列 RabbitMQ</li><li>6、分布式事务 Seata</li><li>7、SaToken 认证与授权框架</li></ul><h3 id="微服务入门" tabindex="-1">微服务入门 <a class="header-anchor" href="#微服务入门" aria-label="Permalink to &quot;微服务入门&quot;">​</a></h3><p>本周我们学习微服务架构技术栈的初级部分，其中的重点是数据库部分。因为任何微服务项目都是先从持久层开始设计的，所以我们要精通数据库集群技术才有资格驾驭大型的微服务项目。 课程安排： 1.Java 项目演进之微服务架构 2. 数据库集群与管理 3. MyCat 中间件实战 4. Elastic-Job 分布式任务调度 5. Minio 分布式文件存储系统及实战 6. NoSQL 数据库之 MongoDB 7. MongoDB 数据库实战 第 32 周 Java 微服务进阶 这一周我们学习微服务架构技术栈的中高级部分，融合了常用组件/中间件，进行微服务架构设计和开发，获取真正的企业级微服务解决方案。 课程安排： 1、微服务注册中心 Nacos 2、微服务注册中心 Nacos 实战 3、微服务远程调用 Feign 4、微服务远程调用 Feign 实战 5、微服务远程调用 Gateway 6、微服务远程调用 Feign 实战 7、微服务流量控制 Sentinel 8、微服务流量控制 Sentinel 实战</p><h3 id="神州大健康双系统项目实战-课程内容持续更新中" tabindex="-1">神州大健康双系统项目实战（课程内容持续更新中） <a class="header-anchor" href="#神州大健康双系统项目实战-课程内容持续更新中" aria-label="Permalink to &quot;神州大健康双系统项目实战（课程内容持续更新中）&quot;">​</a></h3><p>医疗行业是互联网发展前景极好的领域之一，对于初入职者、转行者来说都是很好的选择。课程以业务驱动技术栈，打造完整、全面的双系统项目（健康体检与健康管理两大业务）、界面美观的企业级实战项目，高效积累大型微服务项目经验。</p><p>课程安排：</p><ul><li>1、大健康体检项目全栈环境搭建</li><li>2、基于 SpringCloud 从零构建后端项目</li><li>3、Vue3.0+SpringCloud 实现人员管理模块</li><li>4、Vue3.0+SpringCloud 实现体检套餐模块</li><li>5、利用微信支付 3.0 购买体检套餐</li><li>6、Vue3.0+SpringCloud 实现订单管理模块</li><li>7、 Vue3.0+SpringCloud 实现体检登记模块</li><li>8、Vue3.0+SpringCloud 实现录入体检数据</li><li>9、Vue3.0+SpringCloud 实现人员调流模块</li><li>10、Vue3.0+SpringCloud 实现体检报告查询与管理</li><li>11、项目发布与部署</li><li>12、微服务实战项目总结</li></ul><h3 id="zookeeper-dubbo-应用" tabindex="-1">Zookeeper+Dubbo 应用 <a class="header-anchor" href="#zookeeper-dubbo-应用" aria-label="Permalink to &quot;Zookeeper+Dubbo 应用&quot;">​</a></h3><p>微服务解决方案除了 Spring Cloud 系列，还有 Dubbo 和 Zookeeper 等技术，本周将带大家了解 Dubbo 和 Zookeeper。</p><p>课程安排：</p><ul><li>1、Zookeeper 的下载、配置与运行</li><li>2、Zookeeper 的数据结构与常用命令</li><li>3、使用客户端来对 Zookeeper 进行操作</li><li>4、Dubbo 的工作流程和 RPC 调用</li><li>5、在 Dubbo 架构下，各服务的关系</li><li>6、整合 Dubbo 和 Zookeeper</li><li>7、完成 Dubbo 开发案例</li></ul><h3 id="分布式架构设计与开发实战" tabindex="-1">分布式架构设计与开发实战 <a class="header-anchor" href="#分布式架构设计与开发实战" aria-label="Permalink to &quot;分布式架构设计与开发实战&quot;">​</a></h3><p>分布式架构是大型项目必用的方式，也是云原生、Serverless 等新兴技术的底层基石。后端进阶，必然绕不开分布式。本课程将目前的分布式技术整合为 6 大知识模块，并深度结合案例，将每个细节讲深、讲透，打通进阶路上的关键脉络。</p><p>课程安排：</p><ul><li><ol><li>详细介绍了大型互联网系统架构演进的过程，了解在不同阶段所采用的系统架构是怎么样的，遇到的问题以及技术解决方案。</li></ol></li><li><ol start="2"><li>重点讲解 redis，在实战中熟练使用用分布式缓存提升系统性能。</li></ol></li><li><ol start="3"><li>手写一个自定义缓存注解，更加灵活地处理缓存问题。</li></ol></li><li><ol start="4"><li>使用分布式 ID 高效生成业务 ID。</li></ol></li><li><ol start="5"><li>详析分布式事务的二阶段提交协议和三阶段提交协议，从而更好地理解分布式事务的本质。</li></ol></li><li><ol start="6"><li>介绍开源的分布式事务解决方案-阿里的 Seata 框架，以及可以替换 Saga 模式的更加常见的事务模式，基于消息机制解决分布式事务。</li></ol></li><li><ol start="7"><li>对 ZooKeeper 技术原理进行剖析。</li></ol></li><li><ol start="8"><li>对比 Redis 版分布式版详解如何使用 ZooKeeper 来实现分布式锁。并介绍 Zookeeper 它在集群模式下，是如何去保证可用性和一致性的</li></ol></li><li><ol start="9"><li>剖析了 ZAB 协议和 Paxos 算法</li></ol></li><li><ol start="10"><li>四种场常见的限流算法，分别是计数器限流、滑动窗口限流、漏桶算法，还有令牌桶算法。</li></ol></li><li><ol start="11"><li>讲解基于 Session 的传统认证机制、Token 模式实现登录会话流程、JWT 方式的认证机制、OAuth 流程，了解 JWT 和 OAuth 的区别</li></ol></li><li><ol start="12"><li>分布式链路追踪产生的原因，链路追踪的原理，目前市面选型，重点讲解 skywalking 原理以及使用以及 zipkin。</li></ol></li></ul><h2 id="阶段六-面试与就业指导" tabindex="-1">阶段六：面试与就业指导 <a class="header-anchor" href="#阶段六-面试与就业指导" aria-label="Permalink to &quot;阶段六：面试与就业指导&quot;">​</a></h2><p>3 门课 /课程总时长：7 小时</p><h3 id="高频面试题详解" tabindex="-1">高频面试题详解 <a class="header-anchor" href="#高频面试题详解" aria-label="Permalink to &quot;高频面试题详解&quot;">​</a></h3><p>很多同学技术学的差不多了，项目经验也积累了几个，但要想顺利通过面试，还需要学会如何回答好面试官提出的高频面试问题。本周将为大家传授高通过率的回答经验与技巧。最后奉上面试指导课，助力你早日拿到心仪的 offer。</p><p>课程安排：</p><ul><li>1、HashMap 的底层原理、Spring 字符串的存储原理</li><li>2、Java 中浅复制与深复制、JDK8~JDK15 的新特性</li><li>3、equals、==与 HashCode 之间的区别</li><li>4、垃圾回收与 JVM 内存</li><li>5、Spring IOC 与 DI 的区别、SpringBoot 2.x 的启动过程</li><li>6、Spring 用到了哪些设计模式、 Controller 如何解决跨域访问</li><li>7、MyBatis 的缓存机制、MyBatis 的缓存淘汰策略</li><li>8、常用设计模式考点</li><li>9、INNODB 索引的底层实现原理、INNODB 与 MyiSAM 引擎的区别</li><li>10、HTTPS 的加密传输过程、TCP 三次握手等</li><li>11、高频面试题之常见排序算法</li><li>12、锁的常见面试问题</li><li>13、ConcurrentHashMap 面试常考问题</li><li>14、面试就业指导课</li></ul><h2 id="阶段七-java-源码及性能调优" tabindex="-1">阶段七：Java 源码及性能调优 <a class="header-anchor" href="#阶段七-java-源码及性能调优" aria-label="Permalink to &quot;阶段七：Java 源码及性能调优&quot;">​</a></h2><p>2 门课 /课程总时长：30 小时</p><h3 id="系统解析-jdk-源码" tabindex="-1">系统解析 JDK 源码 <a class="header-anchor" href="#系统解析-jdk-源码" aria-label="Permalink to &quot;系统解析 JDK 源码&quot;">​</a></h3><p>JDK 是 Java 开发工具包，其核心是 Java API 的预定义的类库，这些对开发人员说是必备技能。本周内容覆盖面超全，并结合实际案例手把手式教学，助你系统性掌握 JDK 底层源码、大牛设计思想，在工作中游刃有余。 课程安排：</p><ul><li><ol><li>JDK 源码解读前置和核心函数，助力充分具备 Jdk 基础核心模块的分析应用能力。</li></ol></li><li><ol start="2"><li>对 JDK 集合框架源码及相关数据结构进行深入解析，掌握 JDK 集合框架源码及底层数据结构原理</li></ol></li><li><ol start="3"><li>对 Stream 流式运算原理及使用进行了系统分析，深入理解了 Stream 流的运行机制，具备熟练运用 Stream 流的能力。</li></ol></li><li><ol start="4"><li>对收集器和比较器的用法和原理进行深入解析，掌握收集器以及并行流等 Jdk 底层核心内容</li></ol></li><li><ol start="5"><li>对 Jdk8 疑难部分的源码进阶解析，涉及 groupingBy、IteratorSpliterator、partioningBy、groupingByConcurrent 等模块。深入浅出地让小伙伴理解掌握该部分的源码原理及用法。</li></ol></li><li><ol start="6"><li>Stream 常见应用场景与常用方法实战解析案例 ，让你充分具备 Jdk 基础核心模块的分析应用能力。</li></ol></li><li><ol start="7"><li>深度解析 JDK8 中日期类型使用方法和案例 ，具备熟练运用全新日期和时间 APl 的能力。</li></ol></li><li><ol start="8"><li>对 JDK19 的新特性速览进行全面讲解解析，并且充分阐述 JDK19 新增功能，让小伙伴对 JDK19 新增功能有了较为全面的的了解。</li></ol></li></ul><h3 id="java-性能调优" tabindex="-1">Java 性能调优 <a class="header-anchor" href="#java-性能调优" aria-label="Permalink to &quot;Java 性能调优&quot;">​</a></h3><p>系统学习 Java 项目性能调优，步步为营，斩获 N 种企业级性能调优解决方案。 从易到难掌握各类调优技巧，代码实战+源码剖析+企业灾难案例重现，有节奏地提升与进阶，助力你在职场走得更远飞得更高 。 课程安排：</p><ul><li><ol><li>从数据库优化的多个层面来阐述数据库优化的必要性</li></ol></li><li><ol start="2"><li>学会解读慢查询日志，从慢查询日志中获取相关问题 sql 信息，从而精准调优。</li></ol></li><li><ol start="3"><li>掌握两大慢查询分析工具：mysqldumpslow，pt-query-digest，重点讲解和演示用法和示例，通过 pt-query-digest 利器解读慢查询日志，查找三类问题 SQL。</li></ol></li><li><ol start="4"><li>使用 explain 查看 SQL 执行计划，着重讲解如何解读执行计划，并针对执行计划中重要指标字段进行详细讲解。</li></ol></li><li><ol start="5"><li>全方位 MySQL 调优-灾难案例重演</li></ol></li><li><ol start="6"><li>数据库调优-企业级调优思维</li></ol></li><li><ol start="7"><li>讲解 jvm 调优过程中的常用命令及相关工具，包括 jmap，jhat，jstack，jvisualvm 等常见调优工具以及 MAT 等专业故障排查工具，并通过几个实际案例讲解死锁，内存泄漏等故障排查方法及过程。让大家对 jvm 调优和故障排查过程有一个清晰的认识。</li></ol></li><li><ol start="8"><li>讲解 jvm 调优过程中常见的 GC 算法</li></ol></li></ul>',120),n=[t];function p(s,h,u,d,b,c){return a(),i("div",null,n)}const v=l(r,[["render",p]]);export{m as __pageData,v as default};
